import axios from 'axios';
import Layout from '../components/Layout';

const Index = ({ bpi }) => (
  <Layout>
    <h1>Hello World</h1>
  </Layout>
);

Index.getInitialProps = async () => {
  const res = await axios(
    'https://api.coindesk.com/v1/bpi/historical/close.json'
  );

  console.log(res.data);

  return {
    bpi: res.data,
  };
};

export default Index;
